body{
    text-align: center;
    font-size: 20px;
    padding: 1%;
    font-family: 'Inconsolata';
    background-image: url(de01bee83b4bc7745d0ec5b0fe3ea49b.JPG);
    background-repeat: no-repeat; /* Do not repeat the image */
    background-size: cover;
    -webkit-background-size: cover;
    -moz-background-size: cover;
    -o-background-size: cover;
    color:black;
}

.title-fade-out {
    opacity: 0;
    animation-name: fade-out;
    animation-duration: 1s;
}

.title-fade-in {
    opacity: 100;
    animation-name: fade-in;
    animation-duration: 1s;
}

@keyframes fade-out {
    from { opacity: 100 }
    to { opacity: 0 }
}

@keyframes fade-in {
    from { opacity: 0 }
    to { opacity: 100 }
}


@media all and (min-width: 480px) {
    .Auth {
      padding: 30px 0;
    }

    .Auth form {
      margin: 0 auto;
      max-width: 320px;
    }
}
